import React from 'react';
import './../css/main-page.css';

class TicTacToe extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            gameOver: false,
            oPlaying: false,
            button11: {
                status: false,
                shape: "",
            },
            button12: {
                status: false,
                shape: "",
            },
            button13: {
                status: false,
                shape: "",
            },
            button21: {
                status: false,
                shape: "",
            },
            button22: {
                status: false,
                shape: "",
            },
            button23: {
                status: false,
                shape: "",
            },
            button31: {
                status: false,
                shape: "",
            },
            button32: {
                status: false,
                shape: "",
            },
            button33: {
                status: false,
                shape: "",
            },
        }

        this.play = this.play.bind(this);
        this.restart = this.restart.bind(this);
    };


    componentDidMount(){

    }

    componentWillUnmount(){

    }

    createATempButton(status,shape){
        return button = {
            status,
            shape,
        }
    }

    play(button){
        switch (button) {
            case "11": 
                if(this.state.oPlaying){
                    this.setState({
                        button11: this.createATempButton(true, "o")
                    })
                }else{
                    this.setState({
                        button11: this.createATempButton(true, "x")
                    })
                }
        }
    }

    render(){
        return(
            <div className="principal-page">
                <div className="table-game">
                    <div className="first-row">
                        <button className="button-size button-11" onClick={() => this.play()}/>
                        <button className="button-size button-12"/>
                        <button className="button-size button-13"/>
                    </div>
                    <div className="second-row">
                        <button className="button-size button-21"/>
                        <button className="button-size button-22"/>
                        <button className="button-size button-23"/>
                    </div>
                    <div className="second-row">
                        <button className="button-size button-31"/>
                        <button className="button-size button-32"/>
                        <button className="button-size button-33"/>
                    </div>
                    {console.log(this.state.space)}
                </div>
            </div>
        )
    }
}
export default TicTacToe;
